import { StatusBar } from 'expo-status-bar';
import React from 'react';
import { StyleSheet, Text , View , Button , TextInput, ImageBackground } from 'react-native';
import { Provider as PaperProvider  } from 'react-native-paper';
export default function App() {
  return (

    <ImageBackground source={require('./image/background.png')} style ={style.sreen} >

      <View style={style.inputtext1}>
      <TextInput label="example text" placeholder="nom admin" style ={{width: 200 ,padding :5, marginTop: 70 , marginLeft: 50}} />
      </View>
      <View style={style.inputtext2}>
      <TextInput placeholder="mot de pass" style ={{width: 200,padding :5 ,marginTop: 20 , marginLeft: 50, 
         marginVertical : 50, alignItems: 10}}  />
      </View>
       <View  style ={{padding: 0  , flexDirection : 'row' , justifyContent :'center'}} >
      <Button title="se connecter avec facebook" />
      </View>
      <View style ={{padding: 20 , flexDirection : 'row' , justifyContent : 'center' }} >
      <Button title="se connecter avec email "/>
      </View>

    </ImageBackground>
  );
}
const style = StyleSheet.create({
  sreen :{
    padding : 130 ,
    flexDirection :'column' 

  },
inputtext1:{
  flexDirection :'row' ,
   justifyContent:'center'
},
inputtext2 : {
  padding: 20 ,  flexDirection :'row' , justifyContent:'space-evenly' 
}

});
